import 'aframe';

import React from 'react';



 
class VREx extends React.Component {



  render () {
    return (
     
<a-scene>
<a-entity position="1 1 -1"  scale="15 15 -15" 
              gltf-model={process.env.PUBLIC_URL+"Images/scene.gltf"}
              animation-mixer
              shadow="cast: true; receive: false"
              animation="property: rotation; to: 360 360 360; loop: true; easing: linear; dur: 200000"
              ></a-entity>
  </a-scene>
    );
  }
}


export default VREx;
